import React from "react";
function Nav(props) {
  console.log("nav props", props);
  function toggleTheme(theme) {
    props.setMyTheme(theme === "light" ? "dark" : "light");
  }

  return (
    <div className="navbar">
      {/* <div className="aicon-menu"></div> */}
      <div
        className="nav-link"
        onClick={() => {
          props.poMansRouting("home");
        }}
      >
        {/* <svg className="logo" viewBox="0 0 59 42">
          <path d="M4,38H43L23.5,4ZM43,4V31l4,7h8V4Z" />
        </svg> */}
        <svg className="logo" viewBox="0 0 56 56">
          <path d="M37.38,71A168.78,168.78,0,0,1,66,58.89c3.66-1.17,2.1-7-1.6-5.79a177.43,177.43,0,0,0-30,12.71c-3.4,1.83-.38,7,3,5.18Z" />
          <path
            className="cls-1"
            d="M36.74,11.79a16.18,16.18,0,0,0-12.29,5.8v0l0,0v5.52L34.3,47.81a17.55,17.55,0,0,0,2.44.19C47.24,48,53.5,39.89,53.5,29.9,53.5,18.94,46,11.79,36.74,11.79Z"
          />
          <path d="M19.92,18,31.24,44H8.61L19.92,18m0-10L2.5,48H37.35L19.92,8Z" />
        </svg>
        <svg className="logo" viewBox="0 0 61.98 56">
          <title>ai3</title>
          <path d="M4,46H46L25,10Zm3.48-2L25,14,42.5,44ZM46,10V46H58V10ZM56,44H48V12h8Z" />
        </svg>
      </div>
      <div
        className="nav-link"
        onClick={() => {
          props.poMansRouting("dataViz");
        }}
      >
        DataViz
      </div>
      <div
        className="nav-link"
        onClick={() => {
          props.poMansRouting("portfolio");
        }}
      >
        Portfolio
      </div>
      <div
        className="sunlight-nighttime "
        onClick={() => toggleTheme(props.myTheme)}
      >
        <span className="mr-1">Theme</span>
        {props.myTheme === "light" && <div className="aicon-sun-outline"></div>}
        {props.myTheme === "dark" && <div className="aicon-moon"></div>}
      </div>
    </div>
  );
}

export default Nav;
